import {
  FaFacebookSquare,
  FaInstagram,
  FaTiktok
} from 'react-icons/fa';

const Footer = () => {
  return (
    <div className='max-w-[1240px] flex mx-auto py-16 px-4 mt-24 lg:grid-cols-3 gap-8 text-white text-center justify-center'>
        <div>
            <div className='flex md:w-[75%] my-6 justify-center mx-10'>
                <FaFacebookSquare className='pl-4' size={35} />
                <FaInstagram className='pl-4' size={35} />
                <FaTiktok className='pl-4' size={35} />
            </div>
            <h1 className='w-full text-3xl font-bold text-white'>Neversoft</h1>
            <p className='py-4'>Club D'airsoft | club.neversoft@gmail.com | 0769971007</p>
        </div>
    </div>
  );
};

export default Footer;
